import React, { Component } from 'react';
import Map from './Map'


class Experiences extends Component {

  render() {
    return (
      <div id="experiences">
        <div className="map">
          <div className="map_countries">
            <p className="inactive">Tanzania</p>
            <p className="active">France</p>
            <p className="inactive">Spain</p>
            <p className="inactive">Germany</p>
            <p className="inactive">USA</p>
            <p className="inactive">UK</p>
          </div>
          <Map />
        </div>
        <div className="text">
          <h2>Click on the map to get to know me</h2>
        </div>
      </div>
    );
  }
};

export default Experiences;
